CREATE FUNCTION gpst_crt_cur_ins(datetx date) RETURNS void
    AS $$
DECLARE

    datetx_ text := to_char(datetx, 'YYYYMM01');


    fn_tx1_    text := 'CREATE OR REPLACE FUNCTION gpst_cur_ins (gpstr billservice_groupstat) RETURNS void AS ';

